package org.learning.javapractice.leetcode;

import java.util.*;
import java.util.stream.Collectors;

public class L_242_Anagram {
    public static void main(String[] args) {
        L_242_Anagram service = new L_242_Anagram();

        String s = "";
        String t = "";

        System.out.println(service.isAnagram1(s, t));
    }

    public boolean isAnagram1(String s, String t) {
        char[] s1=s.toCharArray();
        char[] t1=t.toCharArray();
        Arrays.sort(s1);
        Arrays.sort(t1);
        for(int i=0;i<s1.length;i++)
        {
            if(s1[i]!=t1[i])
                return false;
        }
        return true;
    }

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        Map<Character, Integer> a1 = new HashMap<>();
        Map<Character, Integer> a2 = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            char c1 = s.charAt(i);
            a1.put(c1, a1.containsKey(c1) ? a1.get(c1) + 1 : 1);
            char c2 = t.charAt(i);
            a2.put(c2, a2.containsKey(c2) ? a2.get(c2) + 1 : 1);
        }
        if (a1.size() != a2.size())
            return false;

        for (Map.Entry<Character, Integer> entry : a1.entrySet()) {
            if (!(a2.containsKey(entry.getKey()) && a2.get(entry.getKey()).equals(entry.getValue()))) {
                return false;
            }
        }

        return true;
    }
}
